const Index = (data) => {
	let idx = Math.random() * Object.keys(data).length();
	console.log(data[1]);
	return data[1].content.rendered;
};

Index.getInitialProps = async () => {
	const res = await axios.get('https://quotesondesign.com/wp-json/wp/v2/posts/?orderby=rand');
	const { data } = res;
	console.log(data);
	return data;
};

export default Index;
